import React, { useEffect, useState } from "react";
import { useParams } from "react-router-dom";
import {
  getUserData,
  getUserActivity,
  getUserAverageSessions,
  getUserPerformance,
} from "../../services/api.js";
import "./profile.css";

const Profile = () => {
  const { id } = useParams();
  const [userData, setUserData] = useState(null);
  const [userActivity, setUserActivity] = useState(null);
  const [userAverageSessions, setUserAverageSessions] = useState(null);
  const [userPerformance, setUserPerformance] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const user = await getUserData(id);
        const activity = await getUserActivity(id);
        const sessions = await getUserAverageSessions(id);
        const performance = await getUserPerformance(id);

        setUserData(user);
        setUserActivity(activity);
        setUserAverageSessions(sessions);
        setUserPerformance(performance);
        setLoading(false);
      } catch (error) {
        setError(error);
        setLoading(false);
      }
    };

    fetchData();
  }, [id]);

  if (!userData) return <div>Loading...</div>;

  return (
    <section className="profile-container">
      <header className="header">
        <h1>
          Bonjour {userData.userInfos.firstName}
        </h1>
        <p>Félicitations ! Vous avez explosé vos objectifs hier 👏</p>
      </header>
      <main className="main-content">
        <section className="activity">
          <h2>Activité quotidienne</h2>
          <div className="chart" id="daily-activity"></div>
        </section>
        <section className="summary">
          <div className="summary-item calories">
            <p>1,930KCal</p>
            <span>Calories</span>
          </div>
          <div className="summary-item proteins">
            <p>155g</p>
            <span>Protéines</span>
          </div>
          <div className="summary-item carbs">
            <p>290g</p>
            <span>Glucides</span>
          </div>
          <div className="summary-item fats">
            <p>50g</p>
            <span>Lipides</span>
          </div>
        </section>
        <section className="details">
          <div className="average-session">
            <h3>Durée moyenne des sessions</h3>
            <div className="chart" id="average-session-duration"></div>
          </div>
          <div className="intensity">
            <h3>Intensité</h3>
            <div className="chart" id="intensity"></div>
          </div>
          <div className="score">
            <h3>Score</h3>
            <div className="chart" id="score"></div>
            <p>12% de votre objectif</p>
          </div>
        </section>
      </main>
    </section>
  );
};

export default Profile;
